-- Crear base de datos
CREATE SCHEMA  IF NOT EXISTS `mars_dsp` DEFAULT CHARACTER SET utf8 ;
USE  `mars_dsp`;

-- Crear tabla de usuarios
CREATE TABLE IF NOT EXISTS `mars_dsp`.`usuarios` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `nombre` VARCHAR(45) NOT NULL DEFAULT 'El nombre es obligatorio',
  `password` VARCHAR(45) NOT NULL DEFAULT 'La contrase√±a es obligatoria',
  `img` VARCHAR(45) NULL,
  `rol` VARCHAR(45) NOT NULL DEFAULT 'El rol es obligatorio',
  `estado` BINARY(1)  DEFAULT TRUE,
  `createdAt` TIMESTAMP,
  `updatedAt` TIMESTAMP,
  PRIMARY KEY (`id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8;

CREATE TABLE  IF NOT EXISTS `mars_dsp`.`roles` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `rol` VARCHAR(45) NOT NULL DEFAULT 'USER_ROLE',
  PRIMARY KEY (`id`));



CREATE TABLE IF NOT EXISTS `mars_dsp`.`consumos` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `numsilo` INT NOT NULL DEFAULT 1,
  `numbatch` INT NOT NULL DEFAULT 1,
  `numorden` INT NOT NULL DEFAULT 1,
  `gruposilo` VARCHAR(45) NOT NULL DEFAULT 'Cementantes',
  `formula` VARCHAR(45) NOT NULL DEFAULT 'Pegapiso',
  `setpoint` FLOAT NOT NULL,
  `real` FLOAT NULL,
  `iduser` INT NOT NULL DEFAULT 1,
  `turno` INT NOT NULL DEFAULT 1,
  `createdAt` TIMESTAMP NULL,
  `updatedAt` TIMESTAMP NULL,
  PRIMARY KEY (`id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8;


CREATE VIEW `reporte1s` AS
SELECT 
id,
iduser,
  createdAt,
  updatedAt,
	numbatch, 
  formula,
  GROUP_CONCAT( if(numsilo=1,mars_dsp.consumos.real,NULL) ) AS 'Silo_1',
  GROUP_CONCAT( if(numsilo=2,mars_dsp.consumos.real,NULL) ) AS 'Silo_2',
  GROUP_CONCAT( if(numsilo=3,mars_dsp.consumos.real,NULL) ) AS 'Silo_3',
  GROUP_CONCAT( if(numsilo=4,mars_dsp.consumos.real,NULL) ) AS 'Silo_4',
  GROUP_CONCAT( if(numsilo=5,mars_dsp.consumos.real,NULL) ) AS 'Silo_5',
GROUP_CONCAT( if(numsilo=6,mars_dsp.consumos.real,NULL) ) AS 'Silo_6',
  GROUP_CONCAT( if(numsilo=7,mars_dsp.consumos.real,NULL) ) AS 'Silo_7',
  GROUP_CONCAT( if(numsilo=10,mars_dsp.consumos.real,NULL) ) AS 'Carga_quimica_AQ',
  GROUP_CONCAT( if(numsilo=11,mars_dsp.consumos.real,NULL) ) AS 'Carga_quimica_2',
  GROUP_CONCAT( if(numsilo=12,mars_dsp.consumos.real,NULL) ) AS 'TP_2',
  GROUP_CONCAT( if(numsilo=13,mars_dsp.consumos.real,NULL) ) AS 'TP_4',
  
  sum(mars_dsp.consumos.real) as TotalBatch
FROM mars_dsp.consumos
GROUP BY numbatch ;

